A new movement is emerging that encourages people to slow down and appreciate the simplicity of a comfortable and cozy setting. I’m talking about Cabincore. 

Cabincore is an aesthetic that celebrates cabin life and all that comes with it.

Check out my article on this subject by visiting this link https://www.cabinlife.com/articles/cabincore-embracing-simplicity-and-coziness-in-the-modern-world at @yourcabinlife

